import React from "react";
import "./Product.css";
import Box from "./Box";

function Product() {
  return (
    <section id="Product">
      <div className="container">
        <h1 className="compugear_title_h1">Compugear</h1>
        <h2 className="product_title_h2">Products</h2>
      </div>
      <div className="product-item">
        <Box />
      </div>
    </section>
  );
}

export default Product;
